      </View>
      <View style={styles.container2}>
        <Button style={styles.botao1} color='#444444' title='Cadastre o Bichano'></Button>
        <Button style={styles.botao1} color='#444444' title='Cadastre o Medicamento'></Button>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
